var tipuesearch = {"pages": [{'title': 'v1v2v3', 'text': '本學期教學使用綜合教學網站 cadnote (mde.tw) ，支援優化網路環境。課程透過Teams進行實時上課與錄影。考試安排於專屬考試網站進行exam.org。 \n ps.我有使用chatgpt幫我優化語言 \n', 'tags': '', 'url': 'v1v2v3.html'}, {'title': 'v4,v5', 'text': '我們已完成在Replit上的註冊，同時啟用雙重認證功能。我們還成功將GitHub帳戶與Replit帳戶綁定，加入了名為"cad2023"的倉儲。此外，我們已經配置了Replit，以便能夠在GitHub帳戶下編輯名為"cad2023"的倉儲中的內容，並啟動相應的網站。 \n', 'tags': '', 'url': 'v4,v5.html'}, {'title': '任務一模擬測試', 'text': '我們按照老師的步驟對學校網路環境進行了更改(優化)。同時，在進行任務一的零件圖繪畫時，我們選擇了使用Inventor。在完成繪畫後，我們將檔案匯出並轉換成.stl格式。 \n 零件圖雲端共用網址 \n 球:https://drive.google.com/file/d/1xHo7kbYPLGMIsZfhyJEiqyoamfe1JwWw/view?usp=drive_link \n 底座:https://drive.google.com/file/d/1xFTVrnZdcgIE8doHQAiuY_mqGXCo8V8F/view?usp=drive_link \n 桿子:https://drive.google.com/file/d/1srI2gH-FrUUJxkoHmVSWxFMsfCMQn8O8/view?usp=drive_link \n 軌道:https://drive.google.com/file/d/1_bFPCizMPjfhx4qIqGkmMmYf994FW-4i/view?usp=sharing \n 碗公:https://drive.google.com/file/d/1L5zV7-mE8Nf2NAXHO0fQR6xuQ1JamZL2/view?usp=drive_link \n 組合圖雲端共用網址 \n 組合:https://drive.google.com/file/d/15XGblahf6cGaGec66LgtyFvGoRJ-cHEH/view?usp=drive_link \n v8 \n 下載做任務一的文件檔Coppeliasim(類似Onshape的軟體好處是usb可以隨插隨用) 將做好的零件圖在該檔案中組裝起來進行設置(基本都參考上課影片在做邊聽邊做會漏東漏西的) \n 成品雲端共用網址 \n 測試成品檔案:https://drive.google.com/file/d/1hBnTxlbp41jzoAStKK62UFUb3xnBTlYZ/view?usp=drive_link \n \n', 'tags': '', 'url': '任務一模擬測試.html'}, {'title': 'v9v10', 'text': '\n \n \n \n \n \n \n \n \n \n \n \n 在過去兩周裡，主要忙於應對考試和完成任務一。初次參與課程，通過詢問同學發現可以使用電腦和手機參與考試(他們有說查不到)但我還是感覺很穩畢竟有chatgpt。結果考超爛可是我發現考試內容主要來自教學網站。這讓我意識到期末考前需更加認真閱讀網站教材。 \n', 'tags': '', 'url': 'v9v10.html'}, {'title': 's1511(補這幾周進度)', 'text': '由於自己有報名12/2的自動化工程師level1的學科考試,所以我考完期中考後都在看題庫考完後的那周也有立即追趕進度。 \n 但由於沒上過程式的課程(目前正在修計算機程式),進度還是落後人家一段,到這周為止12/22 s1511的進度完成約75趴的內容 \xa0{1). 遠端登入 、2 ) \xa0 如何取放檔案 、3) \xa0 如何與 github 帳號彼此信任 、4) \xa0 如何取下 cad2023 、5) \xa0 如何啟動或關閉 cad2023 倉儲 、6) \xa0 如何連結到動態網站 、7) \xa0 如何設定靜態網站}這些是目前完成的 ( 剩下影片四有卡在程式的部分) 雖然中間有些比較難以理解的部分，組長也很有耐心的教導他真的沒辦法才會請我去問老師。 \n', 'tags': '', 'url': 's1511(補這幾周進度).html'}, {'title': 'V16搞定近端遠端的網址S1511整個結束', 'text': '\n 原本剛做完的時候可以直接點連結到該網站但不知道為什麼現在又不行....我印象中好像是server.py的某個東西沒開啟...下次上課問一下組長好了做完是一回事搞懂他才是重要。 \n 測試python3 server.py \n https://QIUKZ.github.io/cad2023 \n https://s1511.cycu.org/~cad41136113/cad2023 \xa0近端 \n 下禮拜上課沒意外的話可以搞定s1511的部分，繼續往下繼續製作別的內容 \n \n', 'tags': '', 'url': 'V16搞定近端遠端的網址S1511整個結束.html'}, {'title': '上禮拜要求內容', 'text': '因為這周還有考試所以假日時有先研究wink嘗試把任務1的影片推上去，但我開啟replit後發現遇到了第一個問題網站說我的倉儲是不可信任網址，害我上網查詢許多資料才把它弄掉把一些安全裝置的設定關掉弄了快兩個小時吧，弄完就嘗試放影片上去，但我看完飲片還是不知道怎摸，跑去問組長發現我們這組好像沒人會弄這個...所以我就只好放原本的作品連結上來。 \n \n', 'tags': '', 'url': '上禮拜要求內容.html'}, {'title': '期末心得', 'text': '這學期在這門課學到了很多以前沒看過的東西像是github replit 網路設定 類似機電整合模擬的酷東西雖然任務二沒有做完就是了...但還是感到受益良多...主要還是希望能過拉大一還有大概這學期修3門了)門了)的系必修還沒修希望大三前能修完大四可以出去實習主要想賺錢但不想在虎尾打工 \n \n \n  ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n \n', 'tags': '', 'url': '期末心得.html'}]};